namespace iosKeyboardTest {
    public static class KeyboardRenderer {
        public static Control KeyboardView { get; set; }
        static int count = 0;
           static string img1 = "";
            static string img2 = "";
        static string cur_img = img1;


        public static byte[] GetKeyboardImageBytes(double screenScale, int quality = 100) {
            

            //if (!Dispatcher.UIThread.CheckAccess()) {
            //    var result = Dispatcher.UIThread.Invoke(() => {
            //        var result = GetKeyboardImageBytes(screenScale);
            //        return result;
            //    });
            //    return result;
            //}

            if (KeyboardView is not { } rs) {
                count++;
                if (count % 60 == 0) {
                    cur_img = cur_img == img1 ? img2 : img1;
                }
                return Convert.FromBase64String(cur_img);
            }
            return RenderHelpers.RenderToByteArray(rs, screenScale, quality);
        }
        public static void SetError(string msg) {
            if(KeyboardView is { } kbv &&
                kbv.DataContext is KeyboardViewModel kbvm) {
                kbvm.SetError(msg);
            }
        }
        public static void Init(IKeyboardInputConnection conn, Size scaledDesiredSize, double scale, out Size unscaledActualSize) {
            //if (!Dispatcher.UIThread.CheckAccess()) {
            //    Size tempActualSize = default;
            //    Dispatcher.UIThread.Post(() => {
            //        Init(conn, scaledDesiredSize, scale, out tempActualSize);
            //    });
            //    unscaledActualSize = tempActualSize;
            //    return;
            //}
            //if (KeyboardView is { } kbv &&
            //    kbv.DataContext is KeyboardViewModel kbvm) {
            //    kbvm.SetInputConnection(conn);
            //    kbvm.SetDesiredSize(scaledDesiredSize);
            //    unscaledActualSize = new Size(kbvm.TotalWidth * scale, kbvm.TotalHeight * scale);
            //} else {
            KeyboardView = MainView.show_windowless_kb ?
                KeyboardBuilder.Build(conn, scaledDesiredSize, scale, out unscaledActualSize) :
                KeyboardViewModel.CreateKeyboardView(conn, scaledDesiredSize, scale, out unscaledActualSize);
                
            if(!MainView.show_windowless_kb) {
                if (OperatingSystem.IsWindows()) {
                    var hidden_window = new Window() {
                        SizeToContent = SizeToContent.WidthAndHeight,
                        ShowInTaskbar = false,
                        WindowState = WindowState.Minimized,
                        SystemDecorations = SystemDecorations.None,
                        Content = KeyboardView
                    };
                    hidden_window.Show();
                } else if (Application.Current.ApplicationLifetime is ISingleViewApplicationLifetime lt &&
                        lt.MainView is MainView mv &&
                        mv.ContainerCanvas is { } canvas) {
                    if (canvas.Children.OfType<KeyboardView>() is { } kvl) {
                        // remove any existing keyboards
                        foreach (var kv in kvl) {
                            canvas.Children.Remove(kv);
                        }
                    }
                    canvas.Children.Add(KeyboardView);
                    // position keyboard sufficiently outside of screen
                    Canvas.SetTop(KeyboardView, Math.Max(mv.Width, mv.Height) + 1_000);

                }
            }

            if (conn is IHeadlessRender hrd) {
                hrd.OnPointerChanged += (s, e) => {
                    if (KeyboardView.DataContext is not KeyboardViewModel kbvm) {
                        return;
                    }
                    kbvm.SetPointerLocation(e);
                };
            }
        }
    }
}
